import React from "react";
import { NavLink } from "react-router-dom";
import  web1 from  '../src/Images/img1.jpg';



const Cards = (props) =>
{
    return(
    <>
                  <div className="col-md-4 col-10 mx-auto">
                    <div className="card">
                      <img src={props.imgsrc} className="card-image-top" alt="props.imgsrc"></img>
                      <div className="card-body">
                        <h5 className="card-title font-weight-bold"va>Card title</h5>
                        <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                        <NavLink to="#" className="card-btn">Go Some Where</NavLink>
                        
                      </div>
                    </div>
                  </div>

    </>
)
}
export default Cards;
